import React from 'react';
import './Header.css'; 
import logo from './pokemonLogo.png'

function Header() {
  return (
    <header>
      <div className="row justify-content-center">
        <div className="col-md-6">
          <img src={logo} alt=""/>
        </div>
      </div>
    </header>
  )
}

export default Header
